FeedPackage.ReleaseNotes:
Version 0.8.14
Change the base class of the FirstClassCommand class to the TestCommand class.
BREAKING CHANGE before: public class FirstClassCommand : FactCommand { ... } after: public class FirstClassCommand : TestCommand { ... }

Version 0.10.0

Publishes a new nuget package called 'Experiment.Idioms', which facilitates
running idiomatic, regular unit-tests.

This release includes the first idiomatic-test as
`GuardClauseAssertionTestCases`. This assertion verifies guard-clause
assertions for all public API.

[FirstClassTheorem]
public IEnumerable<ITestCase> Demo()
{
    return new GuardClauseAssertionTestCases(typeof(Foo));
}

Version 0.11.0

Supports guard clause test-cases on assembly level.

[FirstClassTheorem]
public IEnumerable<ITestCase> Demo()
{
    return new GuardClauseAssertionTestCases(typeof(Foo).Assembly);
}

Version 0.12.0

- [NEW] ConstructingMemberAssertionTestCases
  This verifies members initialized correctly by a constructor.

  [FirstClassTheorem]
  public IEnumerable<ITestCase> DemoOnTypeLevel()
  {
      return new GuardClauseAssertionTestCases(typeof(Foo));
  }

  [FirstClassTheorem]
  public IEnumerable<ITestCase> DemoOnAssemblyLevel()
  {
      return new GuardClauseAssertionTestCases(typeof(Foo).Assembly);
  }

Version 0.13.0

- [FIX] Changes constructor accessiblity of AccessibilityCollectingVisitor
  from private to protected.

- [FIX] AccessibilityCollectingVisitor returns visitor itself instead of
  throwing NotSupprotedException, when Visit method is called with
  ReflectionElements which does not have any accessiblities.

- [NEW] Adds RestrictingReferenceAssertion to verify referenced assemblies.

  [Fact]
  public void Demo()
  {
      var assertion = new RestrictingReferenceAssertion();
      assertion.Visit(typeof(IEnumerable<object>).Assembly.ToElement());
  }

- [FIX] Splits the Jwc.Experiment.Idioms namespace to Jwc.Experiment and
  Jwc.Experiment.Idioms. (BREAKING-CHANGE)

Version 0.14.0

- [FIX] Makes `ReferenceCollectingVisitor` tread-safe and improves its
  performance.

- [NEW] Introduces the new `RestrictingReferenceAssertion.Verify(Assembly)`
  method to be used to verify that all references of a given assembly are
  correctly specified, instead of using
  `RestrictingReferenceAssertion.Visit(AssemblyElement)`.

  [Fact]
  public void Demo()
  {
      var assertion = new RestrictingReferenceAssertion();
      assertion.Verify(typeof(IEnumerable<object>).Assembly);
  }

- [NEW] Introduces the assertion class `HidingReferenceAssertion` to verify
  that specified assemblies are not directly referenced.

  [Fact]
  public void Demo()
  {
      var assertion = new HidingReferenceAssertion(typeof(Enumerable).Assembly);
      assertion.Verify(typeof(IEnumerable<object>).Assembly);
  }

Version 0.15.0

- [FIX] Slightly improves the message of `HidingReferenceException` in
  `HidingReferenceAssertion`.

- [NEW] Introduces the new `GuardClauseAssertion` class to verify that a
  method or constructor has appropriate Guard Clauses in place.

- [FIX] Lets `ConstructingMemberAssertion` accept only relevant elements.

- [FIX] Deletes the `Verify(Assemlby)` method in `HidingReferenceAssertion`
  and `RestrictingReferenceAssertion` to keep consistency with other
  assertions. Instead use the `AssemblyElement.Accept(IReflectionVisitor<object>)`
  method as the demo below. (BREAKING-CHANGE)

  [Fact]
  public void Demo()
  {
      var assertion = new RestrictingReferenceAssertion();
      typeof(IEnumerable<object>).Assembly.ToElement().Accept(assertion);
  }

Version 0.22.4

- [FIX] Made the construtor of FirstClassCommand accept a testParameterName
  argument. (BREAKING-CHANGE)

  Before:
  public FirstClassCommand(IMethodInfo method, Delegate @delegate, object[] arguments)

  After:
  public FirstClassCommand(IMethodInfo method, string testParameterName, Delegate @delegate, object[] arguments)

- [FIX] Added a new constructor of the TestCase class to show customizable
  test-parameters.

  public TestCase(string testParameterName, Delegate @delegate)

